import { Button } from "~/components/ui/index"
import jsPDF from 'jspdf'

const PrintUCDA = ({ finance, user }) => {
  const brand = finance?.brand;

  const today = new Date();
  today.setDate(today.getDate())
  const options = {
    month: 'short',   // abbreviated month name
    day: '2-digit',   // 2-digit day
    year: 'numeric',  // 4-digit year
    weekday: 'short',  // abbreviated weekday name
    hour: '2-digit',  // 2-digit hour (0-23)
    minute: '2-digit', // 2-digit minute
  };
  const todaysDate = today.toLocaleString('en-US', options);

  const Click10 = () => {
    const doc = new jsPDF()
    const img = 'data:image/jpg;base64,'
    var width = doc.internal.pageSize.getWidth()
    var height = doc.internal.pageSize.getHeight()
    doc.addImage(img, 'JPEG', 0, 0, width, height)
    doc.setFontSize(7)
    doc.text(33, 15, `${todaysDate}`)
    // customer
    doc.setFontSize(9)
    doc.text(10, 35, `${finance.name}`)
    doc.text(10, 43, `${finance.address}`)
    doc.text(103, 43, `${finance.city}`)
    doc.text(150, 43, `${finance.postal}`)
    doc.text(10, 52, `${finance.phone}`)
    doc.text(160, 52, `${finance.email}`)
    // trade
    doc.setFontSize(8)
    doc.text(89, 66, `${finance.tradeYear}`)
    doc.text(99, 66, `${finance.tradeMake}`)
    doc.text(113, 66, `${finance.tradeDesc}`)
    doc.text(160, 66, `${finance.tradeColor}`)
    doc.setFontSize(10)
    doc.text(10, 65, `${finance.tradeVin}`)


    doc.save(`${finance.name}UCDA.pdf`)
  }
  return (
    <Button onClick={Click10} className="h-5 border border-slate12  cursor-pointer hover:text-[#02a9ff] p-5 hover:border-[#02a9ff] hover:border" >
      UCDA
    </Button>
  )
}

export default PrintUCDA
